import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import NavigationBar from './components/NavigationBar';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route  element={<NavigationBar/>}/>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
